var tipuesearch = {"pages": [{'title': '第一周', 'text': '40823125的倉儲 \n 同組的網頁: \n 40823101 \n 40823103 \n 40823104 \n 40823107 \n 40823122 \n 40823127 \n 40823131 \n 40823132 \n 40823136 \n 40823149 \n 40823152 \n', 'tags': '', 'url': '第一周.html'}, {'title': '個人圖檔', 'text': '用Inventor 畫的圖 \n Inventor圖檔影片 \n \n', 'tags': '', 'url': '個人圖檔.html'}, {'title': '組別', 'text': '', 'tags': '', 'url': '組別.html'}, {'title': '第三組體積圖', 'text': '\n', 'tags': '', 'url': '第三組體積圖.html'}, {'title': '第三組體積比較圖', 'text': '\n \n \n', 'tags': '', 'url': '第三組體積比較圖.html'}, {'title': '整組的圖檔', 'text': '', 'tags': '', 'url': '整組的圖檔.html'}, {'title': 'SOLIDWORKS', 'text': '(01-12) \n (13-24) 40823107的體積 \n (25-36) 40823103的體積 \n (37-50) 40823101的圖檔 \n \n', 'tags': '', 'url': 'SOLIDWORKS.html'}, {'title': 'Inventor', 'text': '(01-15) 40823131的圖檔 \n (16-30) 40823125的圖檔 \n (31-40) 40823152的圖檔 \n (41-50) 40823104的圖檔 \n', 'tags': '', 'url': 'Inventor.html'}, {'title': 'onshape', 'text': '(01-25) 40823122的圖檔 \n (26-50) \xa0 40823136的圖檔 \n \n', 'tags': '', 'url': 'onshape.html'}, {'title': '第二周', 'text': 'ssh建立: \n \n 建立公鑰(public key) \n \n 設定儲存路徑 \n \n 載入 \n \n \n 創建密鑰(private key)(ppk檔) \n \n 設定github ssh key \n \n \n 設定putty \n \n', 'tags': '', 'url': '第二周.html'}, {'title': '第七周', 'text': '檔名需用.c為結尾 \n #include <stdio.h>\n\nint main() {\n    printf("Hello, world!\\n");\n    return 0;\n} \n \n 上述程式: \n 發送文字Hello, world! \n /* Runge Kutta for a set of first order differential equations */\n  \n#include <stdio.h>\n#include <math.h>\n  \n#define N 2 /* number of first order equations */\n#define dist 0.1 /* stepsize in t*/\n#define MAX 30.0 /* max for t */\n  \nFILE *output; /* internal filename */\nFILE *output1; /* internal filename */\n// 利用 pipe 呼叫 gnuplot 繪圖\nFILE *pipe;\n  \nvoid runge4(double x, double y[], double step); /* Runge-Kutta function */\ndouble f(double x, double y[], int i); /* function for derivatives */\n  \nvoid main(){\n  \n  double t, y[N];\n  int j;\n  \n  output=fopen("osc.dat", "w"); /* external filename */\n  output1=fopen("osc1.dat", "w"); /* external filename */\n  \n  y[0]=1.0; /* initial position */\n  y[1]=-2.0; /* initial velocity */\n  \n  //fprintf(output, "0\\t%f\\n", y[0]);\n  \n  for (j=1; j*dist<=MAX ;j++) /* time loop */{\n  \n    t=j*dist;\n    runge4(t, y, dist);\n    fprintf(output, "%f\\t%f\\n", t, y[0]);\n    fprintf(output1, "%f\\t%f\\n", t, y[1]);\n  }\n  \n  fclose(output);\n  fclose(output1);\n  \n  pipe = popen("gnuplot -persist","w");\n  //fprintf(pipe,"set term png enhanced font \\"v:/fireflysung.ttf\\" 18 \\n");\n  fprintf(pipe,"set term png enhanced font \\"y:/wqy-microhei.ttc\\" 18 \\n");\n  //fprintf(pipe,"set yrange [68:70]\\n");\n  fprintf(pipe,"set output \\"test.png\\"\\n");\n  fprintf(pipe, "plot \\"osc.dat\\" title \\"位移\\" with lines, \\"osc1.dat\\" title \\"速度\\" with lines\\n");\n  fprintf(pipe,"quit\\n");\n \n  fprintf(pipe,"quit\\n");\n  pclose(pipe);\n}\n  \nvoid runge4(double x, double y[], double step){\n  \n  double h=step/2.0, /* the midpoint */\n  t1[N], t2[N], t3[N], /* temporary storage arrays */\n  k1[N], k2[N], k3[N],k4[N]; /* for Runge-Kutta */\n  int i;\n  \n  for (i=0;i<N;i++){\n  \n    t1[i]=y[i]+0.5*(k1[i]=step*f(x,y,i));\n  }\n  \n  for (i=0;i<N;i++){\n  \n    t2[i]=y[i]+0.5*(k2[i]=step*f(x+h, t1, i));\n  }\n  \n  for (i=0;i<N;i++){\n  \n    t3[i]=y[i]+ (k3[i]=step*f(x+h, t2, i));\n  }\n  \n  for (i=0;i<N;i++){\n  \n    k4[i]= step*f(x+step, t3, i);\n  }\n  \n  for (i=0;i<N;i++){\n  \n    y[i]+=(k1[i]+2*k2[i]+2*k3[i]+k4[i])/6.0;\n  }\n}\n  \ndouble f(double x, double y[], int i){\n  \n  if (i==0)\n    x=y[1]; /* derivative of first equation */\n  if (i==1)\n    x=-y[0]-0.5*y[1];\n  return x;\n} \n \n 上述程式: \n 質量為 1kg 物理, 以 k=1 彈簧與 b=0.5 阻尼器連接在固定牆壁, 起始拉開 1m, 速度為０ 時放開, 求放開質量後的運動模擬. \n x ( t ) \xa0 表示質量拉開水平方向設為正向 x, 且為時間 t 的函式 \n 起始條件: x ( 0 ) =-2 .0 ， x ˙ ( 0 ) =1 \n 以下利用程式定義解題: \n x = y [ 0 ] \n x ˙ = y [ 1 ] \n x ¨ = − y [ 0 ] − 0.5 ∗ y [ 1 ] \n 並產生數值運算結果: \n', 'tags': '', 'url': '第七周.html'}]};